import React from 'react'
import Box from './Box'
import styled from 'styled-components'

const BaseUl = styled(Box)`
  padding:0;
  list-style:none;
`

export function Ul(props:React.PropsWithChildren<{}>) {
  const {children} = props
  return <BaseUl as="ul" {...props}>{children}</BaseUl>
}
